INSERT INTO `content` (`ID`, `tresc`) VALUES
(1, 'REDsec to grupa ekspertów, zajmująca się bezpieczeństwem teleinformatycznym. Dbamy o bezpieczeństwo naszych klientów na wielu płaszczyznach - prowadzimy symulacje ataków na sieci, wykonujemy testy penetracyjne, audytujemy organizacje zgodnie z wymaganiami normatywnymi ISO 27001 (System Zarządzania Bezpieczeństwem Informacji), wysyłamy naszych konsultantów wspomagających działy bezpieczeństwa klientów, oraz konsultujemy i doradzamy w zakresie bezpieczeństwa rozwiązań chmurowych (AWS, Azure). Nasi konsultanci oraz testerzy posiadają certyfikację potwierdzającą ich doświadczenie oraz kompetencje - nie brakuje u nas osób posiadających najbardziej znane spośród certyfikatów - CISSP, CEH, OSCP, CompTIA Security + oraz innych z zakresu bezpieczeństwa teleinformatycznego. Wybierając współpracę z nami możesz mieć pewność, że wykwalifikowani specjaliści zajmą się bezpieczeństwem Twojej organizacji!'),
(2, 'Testy penetracyjne to praktyczne badanie bezpieczeństwa systemu IT. Prowadzimy je w taki sposób, aby jak najlepiej oddać sposób działania przestępców, co pozwala na określenie poziomu bezpieczeństwa badanego systemu. Oprócz znalezienia luk bezpieczeństwa, dostarczymy Państwu raport, który merytorycznie opisze zidentyfikowane błędy, oraz zaproponuje dostosowaną do potrzeb klienta ścieżkę naprawy błędu. Prowadzimy testy w trzech typach. Black Box (gdzie testerzy nie posiadają wiedzy na temat systemu. Klient dostarcza wyłącznie adres IP lub nazwę domeny, która ma zostać poddana testom. Jest to najlepsze odzwierciedlenie działań hakerów), Gray Box (gdzie testerzy posiadają częściową wiedzę na temat badanego systemu oraz jego architektury. Pozwala to na dokładniejszy test, który może wykazać występowanie podatności w innych obszarach. Testerzy otrzymują w tym typie testów dostęp do kont o różnym poziomie uprawnień, co może wykazać występowanie luk bezpieczeństwa np. w panelu administracyjnym aplikacji WEB) oraz White Box (gdzie testerzy mają pełną wiedzę na temat systemu oraz jego architektury, w tym posiadają dostęp do kodu źródłowego tego systemu. Pozwala to na wykrycie np. ukrytych przez programistów backdoorów, pozwalających na uzyskanie dostępu do aplikacji bez wiedzy jego właściciela biznesowego). W trakcie testów wykorzystujemy profesjonalne oprogramowanie takie jak Burp Suite oraz Nessus, wykorzystujemy zarówno skanery automatyczne jak i własną wiedzę i doświadczenie, próbując znaleźć błędy bezpieczeństwa poprzez testy manualne.'),
(3, 'Oferujemy wdrożenie systemów zgodnych z ISO 27001 (System Zarządzania Bezpieczeństwem Informacji) oraz ISO 22301 (System Zarządzania Ciągłością Działania). W ramach wdrożenia prowadzimy również coroczne audyty tych systemów. Audytujemy również systemy wdrożone przez inne firmy bądź wdrożone samodzielnie przez organizację. Audyty mogą wykazać niezgodności z wymaganiami normatywnymi oraz dać podstawę do wdrożenia zmian, które pozwolą na uzyskanie pełnej zgodności. Utrzymanie dobrej kondycji SZBI oraz SZCD jest bardzo ważne dla poprawnego ich funkcjonowania wewnątrz firmy. Ich celem jest ciągłe doskonalenie (w tym poprzez audyty wykonywane przynajmniej raz do roku, oraz po każdej dużej zmianie w działaniu tych systemów). Audyty zapewniają kierownictwu wiedzę o poprawnym funkcjonowaniu systemów. Nasi konsultanci posiadają certyfikację audytorów wiodących ISO 27001 oraz ISO 22301, co potwierdza ich kompetencje do prowadzenia audytów.'),
(4, 'Nasi konsultanci mogą wspomóc Państwa dział bezpieczeństwa oraz inne działy na wielu płaszczyznach. Oferujemy organizację szkoleń z różnych zakresów - szkolimy działy bezpieczeństwa z testów penetracyjnych, działy administracyjne z prawidłowego zarządzania SZBI oraz SZCD,, szeregowych pracowników z metod wykrywania ataków (co podnosi ich świadomość i pozwala na uniknięcie takich ataków jak np. ataki phishingowe), pomagamy w utrzymaniu niezbędnej dokumentacji i rejestrów w zgodności z prawem, pomagamy w przygotowaniu oraz utrzymaniu procesu tworzenia kopii zapasowych, oferujemy dostęp do naszych konsultantów w ramach zewnętrznego działu bezpieczeństwa - pozwala to obniżyć koszty, ponieważ organizacja nie musi szukać stałych pracowników posiadających wiedzę z zakresu bezpieczeństwa - a w zamian pozwala również uzyskać dostęp do ekspertów z wielu dziedzin połączonych z bezpieczeństwem teleinformatycznym - prawników, programistów, pentesterów, konsultantów. Pomagamy w ten sposób zabezpieczyć Państwa organizację przed naruszeniem aspektów bezpieczeństwa z zewnątrz oraz wewnątrz.'),
(5, 'Bezpieczeństwo chmury - cloud security - to rosnący problem. Wiele aspektów nie jest zrozumiałych w przypadku przeniesienia swojej infrastruktury do chmury. Jak mamy zabezpieczyć urządzenia, do których nie posiadamy dostępu fizycznego. Nasi konsultanci oraz prawnicy pomogą ze wszystkimi formalnościami - umowami SLA oraz umowami o powierzenie przetwarzania danych osobowych (w zgodności z Rozporządzeniem o Ochronie Danych Osobowych). Nasi inżynierowie zajmujący się na codzień technologiami chmurowymi (AWS, Azure) pomogą również w przeprowadzeniu audytu środowiska chmurowego oraz wesprą w zabezpieczeniu go przed atakami. Mogą pomóc również ograniczyć koszt wykorzystywania urządzeń w chmurze dostawcy poprzez przegląd uruchomionych usług oraz doradzić, czy zmiany pomogą obniżyć koszt. Jesteśmy również partnerami biznesowymi takich firm jak Cloudflare oraz Fortinet oraz oferujemy wdrożenie ich rozwiązań z zakresu bezpieczeństwa rozwiązań chmurowych. ');

